/*Table structure for table `tb_qiku_apk_white_list` */

DROP TABLE IF EXISTS `tb_qiku_apk_white_list`;

CREATE TABLE `tb_qiku_apk_white_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) DEFAULT NULL COMMENT 'APK名称',
  `package` varchar(128) NOT NULL COMMENT 'APK包名',
  `version` varchar(32) DEFAULT NULL COMMENT 'APK版本',
  `type` varchar(32) DEFAULT NULL COMMENT 'APK类型',
  `level_id` int(4) NOT NULL DEFAULT '0' COMMENT '1：一级白名单 2：二级白名单',
  `attribute_code` varchar(32) DEFAULT NULL COMMENT '特征码',
  `icon_url` varchar(128) DEFAULT NULL COMMENT 'icon地址',
  `dl_url` varchar(128) DEFAULT NULL COMMENT '下载地址',
  `md5` varchar(64) DEFAULT NULL COMMENT 'apk md5',
  `sign` varchar(64) DEFAULT NULL COMMENT '签名',
  `activity` varchar(1024) DEFAULT NULL,
  `insert_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_time` varchar(32) DEFAULT NULL,
  `flag` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
