/*Table structure for table `tb_qiku_tf_policy_info` */

DROP TABLE IF EXISTS `tb_qiku_tf_policy_info`;

CREATE TABLE `tb_qiku_tf_policy_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `guid` varchar(64) DEFAULT NULL COMMENT '平安去重标示',
  `deviceid` varchar(32) DEFAULT NULL COMMENT '设备号',
  `tf_policy_id` varchar(32) DEFAULT NULL COMMENT '保单号',
  `start_time` varchar(20) DEFAULT NULL COMMENT '保障开始时间',
  `end_time` varchar(20) DEFAULT NULL COMMENT '保障接收时间',
  `applyTime` varchar(20) NOT NULL DEFAULT '0' COMMENT '申请时间',
  `insert_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_time` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

