/*Table structure for table `tb_qiku_tf_policy_user_info` */

DROP TABLE IF EXISTS `tb_qiku_tf_policy_user_info`;

CREATE TABLE `tb_qiku_tf_policy_user_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
